INSERT INTO catalog_comp VALUES ('0f1e0c3d-103a-4528-b0ae-8be8a0b0d59b', 991, 'Get Ring''s best image quality with Outdoor Cam Plus and Indoor Cam. Enjoy 2K clarity, HD video, and Color Night Vision for added security. Monitor pets or family, and use the Privacy Cover to disable the camera and mic when privacy is needed.', false, 'Outdoor Cam Plus Battery + Indoor Cam (2nd Gen) by Ring', 'webshop.catalog.core.CatalogImpl', 'data:image/png;base64,', 2281166, '5e82cf85-7158-4a4d-b329-1f9aa6998926', '1229ff33-6dd2-4c0a-b113-a90ee32a01ca', 'catalog_impl') ON CONFLICT DO NOTHING;
INSERT INTO catalog_comp VALUES ('92804d01-4723-4d9c-b6e2-066c8b494921', 795, 'Eilik is a new kind of robot with emotional intelligence that brings up a higher level of social interactions between humans and robots. He is the one that eases our life and is our companion whenever we need him. He is our very robotic friend.', false, 'Eilik by Energize Lab', 'webshop.catalog.core.CatalogImpl', 'data:image/jpeg;base64,', 2264872, '4a86b274-151e-433e-8659-0a61d86076d1', '1229ff33-6dd2-4c0a-b113-a90ee32a01ca', 'catalog_impl') ON CONFLICT DO NOTHING;
INSERT INTO catalog_comp VALUES ('b44b2711-8a97-478f-acbb-86521c004497', 693, 'WINBOT W2 PRO OMNI introduced the cutting-edge window cleaning station - an all-in-one multi-purpose dock that can serve as a control panel, changer, stabler and the portable storage room for your window cleaning task.', false, 'WINBOT W2 PRO OMNI by ECOVACS', 'webshop.catalog.core.CatalogImpl', 'data:image/png;base64,', 11389540, 'aff01f77-0f47-4be4-bba6-3b65078d341c', '1229ff33-6dd2-4c0a-b113-a90ee32a01ca', 'catalog_impl') ON CONFLICT DO NOTHING;
INSERT INTO catalog_comp VALUES ('b53b167e-a294-449f-8acc-2614a92cd43d', 598, 'The newly launched GOAT A3000 LiDAR is designed to excel in maintaining middle to large sized backyards, offering an exceptional gardening experience.', false, 'GOAT A3000 LiDAR by ECOVACS', 'webshop.catalog.core.CatalogImpl', 'data:image/png;base64,', 40735122, '05fe44dc-fab2-4d5b-866c-760bbda1a90c', '1229ff33-6dd2-4c0a-b113-a90ee32a01ca', 'catalog_impl') ON CONFLICT DO NOTHING;
INSERT INTO catalog_comp VALUES ('369d311d-3b90-4088-ac82-c3d4e67423b9', 796, 'Built with multiple sensors and cutting-edge techs, EMO is a cool desktop AI robot pet with character that can self-explore the world and react to you with more than 1000 faces and movements.', false, 'EMO by living.ai', 'webshop.catalog.core.CatalogImpl', 'data:image/jpeg;base64,', 4708980, '4a86b274-151e-433e-8659-0a61d86076d1', '1229ff33-6dd2-4c0a-b113-a90ee32a01ca', 'catalog_impl') ON CONFLICT DO NOTHING;
INSERT INTO catalog_comp VALUES ('4655ded4-e84d-4232-b8a3-0a0b24b5597b', 697, 'The Dolphin Proteus DX5i pool cleaner robot is supported by Maytronics'' 40 years of experience, guaranteeing a sparkling clean pool and ready for fun!', false, 'Dolphin Proteus DX5i by Maytronics', 'webshop.catalog.core.CatalogImpl', 'data:image/png;base64,', 21182263, '05fe44dc-fab2-4d5b-866c-760bbda1a90c', '1229ff33-6dd2-4c0a-b113-a90ee32a01ca', 'catalog_impl') ON CONFLICT DO NOTHING;
INSERT INTO catalog_comp VALUES ('a2168f07-ecb6-45c4-86ef-dc486da8c236', 494, 'ElliQ is an AI social robot for older adults that offers companionship and support. It proactively initiates conversations, provides medication reminders, encourages physical activity, and helps connect users with loved ones.', false, 'ElliQ 2.0', 'webshop.catalog.core.CatalogImpl', 'data:image/png;base64,', 4057218, '4a86b274-151e-433e-8659-0a61d86076d1', '1229ff33-6dd2-4c0a-b113-a90ee32a01ca', 'catalog_impl') ON CONFLICT DO NOTHING;
INSERT INTO catalog_comp VALUES ('feac3a82-757f-44af-a057-39e4f3ea0715', 698, 'Experience hands-free cleaning with DEEBOT T10 OMNI. Its all-in-one OMNI Station maintains the vacuum automatically. With AI, voice assistant, and strong suction, it offers seamless, stress-free home cleaning.', false, 'DEEBOT T10 OMNI by ECOVACS', 'webshop.catalog.core.CatalogImpl', 'data:image/jpeg;base64,', 32588097, 'aff01f77-0f47-4be4-bba6-3b65078d341c', '1229ff33-6dd2-4c0a-b113-a90ee32a01ca', 'catalog_impl') ON CONFLICT DO NOTHING;
